// src/Profile.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Profile() {
  const [profile, setProfile] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const token = localStorage.getItem("access_token");
        const res = await fetch("http://localhost:8000/profile", {
          headers: { Authorization: `Bearer ${token}` },
        });
        if (!res.ok) {
          navigate("/login");
          return;
        }
        const data = await res.json();
        setProfile(data);
      } catch (err) {
        navigate("/login");
      }
    };
    fetchProfile();
  }, []);

  if (!profile) return <div>Loading profile...</div>;

  return (
    <div>
      <h2>Profile / Job Preferences</h2>
      <button onClick={() => navigate("/dashboard")}>Dashboard</button>
      <div>
        <p><strong>Domains:</strong> {profile.domains?.join(", ")}</p>
        <p><strong>Roles:</strong> {profile.roles?.join(", ")}</p>
        <p><strong>Experience:</strong> {profile.years_experience} years</p>
        <p><strong>Work Mode:</strong> {profile.work_modes?.join(", ")}</p>
        <p><strong>Location:</strong> {profile.location}</p>
        <p><strong>Visa Sponsorship:</strong> {profile.visa_sponsorship}</p>
      </div>
    </div>
  );
}
